import LoginImg from "../asset/1.svg";
import { Link } from "react-router-dom";
import "../style/Login.css";

const Login = () => {
  return (
    <div className="login-container">
      <div className="my-text">Masak Yuk</div>
      <div className="box-container">
        <div className="img-container">
          <img src={LoginImg} alt="" className="login-img" />
        </div>
        <div className="form-container">
          <div className="form-text">Sign In</div>
          <form action="" className="form-box">
            <label>
              Email <input type="email" className="email" />
            </label>
            <label>
              Password <input type="password" />
            </label>
            <p>
              Klick{" "}
              <Link to="/singup" className="link logo">
                Sign Up
              </Link>{" "}
              untuk membuat akun baru
            </p>
            <button className="login-btn">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Login;
